caption.p:
Binding of CATH-B1 to PR8 virus. CATH-B1 was pre-incubated with H1N1 virus after which peptide and virus were separated using Capto beads. (Virus containing) supernatant was then used to infect MDCK cells. Viral infection was determined by immunofluorescent detection of IAV nuclear protein. Three images per well were taken and the infected cells were counted. The infection rate in the presence of cathelicidins was normalized against only virus-treated wells. Data are represented as mean ± SEM of three independent experiments of triplicate samples per experiment 
   ∗
   p ≤ 0.05; 
   ∗∗
   p ≤ 0.01; 
   ∗∗∗
   p ≤ 0.005; 
   ****
   p ≤ 0.001.
